    public function testGetAssignedDashlets()
    {
        $preferencesArray = array();
        for ($j=0; $j<1; $j++) {
            $tmpObject = $this->getMock('UserPreference');
            $tmpObject->assigned_user_id = $j+1;
            $tmpObject->contents = '';
            $preferencesArray[] = $tmpObject;
        }

        $mockUserPreference = $this->getMock('UserPreference', array('get_full_list'));
        $orderBy = '';
        $where   = 'category=\'HOME\'';
        $mockUserPreference->expects($this->exactly(1))
                ->method('get_full_list')
                ->with($orderBy, $where)
                ->will($this->returnValue($preferencesArray));
        
        $this->accessManager->setPreferenceRetriever($mockUserPreference);
        $resultArray = $this->accessManager->getAssignedDashlets();
        $this->assertInternalType('array', $resultArray);
        $this->assertSameSize($preferencesArray, $resultArray);
        foreach ($resultArray as $key => $preference) {
            $this->assertInternalType('object', $preference);
            $this->assertObjectHasAttribute('id', $preference);
            $this->assertObjectHasAttribute('dashlets', $preference);
            $this->assertInternalType('array', $preference->dashlets);
            $this->assertContains('BpmnProjectDashlet', $preference->dashlets);
            $this->assertContains('CasesByProcessChartDashlet', $preference->dashlets);
            $this->assertContains('CasesByUserChartDashlet', $preference->dashlets);
            $this->assertContains('BusinessRulesListDashlet', $preference->dashlets);
            $this->assertContains('EmailTemplateDashlet', $preference->dashlets);
        }
        
    }
    
