    public function testProcessDashletData()
    {
        $id = 'aiwehawj2389djxq23478dj1823';
        $dashletData = '';
        $dataProcessed = $this->accessManager->processDashletData($id, $dashletData);
        $this->assertInternalType('object', $dataProcessed);
        $this->assertObjectHasAttribute('id', $dataProcessed);
        $this->assertEquals($dataProcessed->id, $id);
        $this->assertObjectHasAttribute('dashlets', $dataProcessed);
        $this->assertInternalType('array', $dataProcessed->dashlets);
        $this->assertCount(3, $dataProcessed->dashlets);
        //$this->assertContains('BpmInboxDashlet', $dataProcessed->dashlets);
        $this->assertContains('BpmnProjectDashlet', $dataProcessed->dashlets);
        $this->assertContains('BusinessRulesListDashlet', $dataProcessed->dashlets);
        $this->assertContains('EmailTemplateDashlet', $dataProcessed->dashlets);
