    public function testGetDashletsByUserWithData()
    {
        $mockUser = new stdClass();
        $mockUser->id = 10;
        
        $preferenceOne = new stdClass();
        $testTextOne = array('dashlets'=>array(array('className'=>'SomeDashlet1')));
        $preferenceOne->assigned_user_id = 1;        
        $preferenceOne->contents = base64_encode(serialize($testTextOne));
        $expectedObjectOne = new stdClass();
        $expectedObjectOne->id = 1;
        $expectedObjectOne->dashlets = array();
        //$expectedObjectOne->dashlets = array('SomeDashlet1');
        
        $preferenceTwo = new stdClass();
        $testTextTwo = array('dashlets'=>array(array('className'=>'SomeDashlet2')));
        $preferenceTwo->assigned_user_id = 2;
        $preferenceTwo->contents = base64_encode(serialize($testTextTwo));
        $expectedObjectTwo = new stdClass();
        $expectedObjectTwo->id = 2;
        $expectedObjectTwo->dashlets = array();
        //$expectedObjectTwo->dashlets = array('SomeDashlet2');
        
        $preferenceThree = new stdClass();
        $testTextThree = array('dashlets'=>array(array('className'=>'SomeDashlet3')));
        $preferenceThree->assigned_user_id = 3;
        $preferenceThree->contents = base64_encode(serialize($testTextThree));
        $expectedObjectThree = new stdClass();
        $expectedObjectThree->id = 3;
        $expectedObjectThree->dashlets = array();
        //$expectedObjectThree->dashlets = array('SomeDashlet3');
        
        $preferenceFour = new stdClass();
        $testTextFour  = array('dashlets'=>array(array('className'=>'SomeDashlet4')));
        $preferenceFour->assigned_user_id = 4;
        $preferenceFour->contents = base64_encode(serialize($testTextFour));
        $expectedObjectFour = new stdClass();
        $expectedObjectFour->id = 4;
        $expectedObjectFour->dashlets = array();
        //$expectedObjectFour->dashlets = array('SomeDashlet4');

        $expectedPreferences = array($preferenceOne, $preferenceTwo, $preferenceThree, $preferenceFour);
        $expectedDashlets = array($expectedObjectOne, $expectedObjectTwo, $expectedObjectThree, $expectedObjectFour);
        
        $mockPreference = $this->getMockBuilder('UserPreference')
            ->setMethods(array('get_full_list'))
            ->disableOriginalConstructor()
            ->getMock();
        $orderBy = "";
        $where = "category='HOME' AND assigned_user_id='{$mockUser->id}'";
        $mockPreference->expects($this->exactly(1))
            ->method('get_full_list')
            ->with($orderBy, $where)
            ->will($this->returnValue($expectedPreferences));        
        $this->accessManager->setPreferenceRetriever($mockPreference);
        $this->assertEquals($expectedDashlets, $this->accessManager->getDashletsByUser($mockUser));        
    }
    
